q($,"azk","akI",function(){var p=null
return H.c([K.iP("Music App","In my early days when I started learning to program mobile applications, I did a lot of trial and error, the truth is about 5 times I have made this application because I did not end up liking the design (I am not a designer), but I always wanted to launch a music player application with equalizer, which works completely fine but I haven't finished it due to time and dedication to the project.\n\nCompilation in native library is brutally fast especially with Java, much more than using different frameworks. I even realized that dependencies like Facebook's for the use of images with blur greatly diminish the performance of any application, its compilation way is quite strange considering that it first has to redraw the whole view before showing it to the user.\n\nThe link that I will leave for access is the old version of the application, for privacy reasons and because I intend to publish the new one at some point. I also made an IOS version with Objective-C using the MusixMatch library to see the lyrics in real time while the song is playing.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877028/portfolio/logos/music_yghxw1.jpg","https://github.com/nekomaruh/neko_fx_music_player"),K.iP("Find me","I did this project in collaboration with industrial students from the Universidad Cat\xf3lica del Norte, basically it was based on a map that included the buildings of the university, where through the use of Bluetooth you could see different buildings and the rooms of each of these mainly made for new students who did not know the facilities.\n\nThis technology uses MAC addresses with bluetooth modules distributed at different points stored in a local database on the mobile phone and specially made for devices without internet connection.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877014/portfolio/logos/find_me_nkdren.jpg",p),K.iP("Movies App","It is an application that uses the public API of themoviedb.com.\n\nIt is an example to show the most popular movies on the movie theaters in real time, the movie score, a short description and the actors who participated in it.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877023/portfolio/logos/movies_1_vlvsso.jpg","https://github.com/nekomaruh/movies_using_themoviedb_api"),K.iP("Nanny","It is an application created for entrepreneurship at Tecnol\xf3gico de Monterrey, similar to uber but to search for babysitters within a range of area on the map.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877036/portfolio/logos/nanny_p3ptvc.png",p),K.iP("Store-Catalog","It is a personal project that is still in development, it aims to create virtual stores for people who work in free fairs without having to pay for a physical position, which can register, upload their products and generate a catalog from this.\n\nA chat and online payments are also added where the customer can interact, make payment and cancel products if necessary, scoring both the seller and the customer in question.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877002/portfolio/logos/catalog_znba1s.png",p),K.iP("Linear Regression","It is a desktop application developed in conjunction with Wladislaw Rabinski at Tecnol\xf3gico de Monterrey, specifically it works for the MacOS operating system, its purpose is to read text files that have input values in their content to calculate and graph the linear regression of said values of entry.\n\nThis program is based on 3 programming languages: Swift for creating the graphics, C for calculating the entire mathematical process of linear regression, and Objective-C for the visual part of the buttons, icons and window texts.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877055/portfolio/logos/regression_x8gfvo.png","https://github.com/nekomaruh/cocoa-app-linear-regression"),K.iP("Data Analysis","It is an analysis of a large dataset that contains data on the universities in Chile, careers, venues and regions where these careers are taught.\n\nMore than anything, it is a generic analysis doing the entire ETL process in relation to the careers, cleaning and generating a multidimensional database, giving visual results through PowerBI.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877008/portfolio/logos/etl_ukks3l.png","https://github.com/nekomaruh/analytic_data_etl/tree/main/Sies%20BI%20-%20Multidimensional"),K.iP("Prothesis G\xe9nesis","This project is for saving private patients information of the prothesis they use in Laboratorio G\xe9nesis.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1610409199/portfolio/logos/Captura_de_Pantalla_2021-01-11_a_la_s_20.52.06_getu26.png",p),K.iP("Covid dark mode","This is a project carried out at the Universidad Cat\xf3lica del Norte that aims to have a record through a blog of the people who are or were infected with Covid-19. In order for this to work, we basically use the bluetooth MACs of people's devices, this means that when walking down the street you can detect another person registered in our Blockchain that is infected and thus notify other people both through notifications application, such as emails.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877049/portfolio/logos/pedrenevid_qj5vj8.png",p),K.iP("Printer Bluetooth","This project came about thanks to my mother. She worked at free fairs and for reasons of life she stopped going and began to create her small business and sell small products from home.\n\nOne day we decided to make purchases on Aliexpress and we found a thermal printer which works without ink or toner and with some special paper rolls for its use, so I decided to investigate more about the subject.\n\nFinally I decided to make this application so that she could print the tickets of the products that she sells to her clients and also showing a QR code so that they could access her personal sales catalog.","https://res.cloudinary.com/doqebrksl/image/upload/q_auto,c_scale,w_1024/v1609877049/portfolio/logos/printer_xnd92s.jpg",p)],H.a1("t<EV*>"))})
